import React, { useContext } from "react";
import "./popUpStyles/serviceBooking.css";
import { CompanyServiceList } from "../../companyData";
function ServiceBooking(props) {
  const { CompanyListDataArray } = useContext(CompanyServiceList);

  function clearAbutton() {
    console.log("clear button clicked");
  }
  function bookButton() {
    console.log("book button clicked");
  }
  function closePopUp() {
    console.log("popup close");
  }

  return (
    <div className="popUp-serviceWrapper">
      <div className="serviceLink">
        <h3>anchor</h3>
        <div className="closePopUpBtn">
          <button onClick={closePopUp}>close</button>
        </div>
      </div>
      <div className="popUpserviceContent">
        <div className="serviceBooking-fliterContainer">
          <div className="clearAllBtnConatainer">
            <h3 className="filterHeader"> Filter</h3>
            <div className="clearRangeBtn-container">
              <button type="button" onClick={clearAbutton}>
                clear all
              </button>
            </div>
          </div>
          <div className="filter-formContainer">
            <form action="">
              <div className="search">
                <h3>Search for cleacning service</h3>
                <div className="searchContainer">
                  <input type="text" />
                </div>
              </div>

              <div className="range">
                <h3>Price range</h3>
                <div className="rangeContainer">
                  <input
                    type="text"
                    className="minimumRange"
                    placeholder="Min"
                  />
                  <hr />
                  <input type="text" className="maxRange" placeholder="Max" />
                </div>
              </div>
            </form>
          </div>
        </div>

        <div className="listScrollContainer">
          <div
            className="serviceBooking-companyList"
            id="serviceListingContainer">
            {/* CARDS CONTENTS TO MAP */}

            {[...CompanyListDataArray].map((item) => {
              const {
                id,
                companyName,
                aboutCompany,
                serviceList,
                minPrice,
                maxPrice,
              } = item;
              let splitin = serviceList;
              console.log(splitin);
              return (
                <div className="listWrapper" key={id}>
                  <div className="list-imageContainer">
                    <img
                      src="https://images.pexels.com/photos/5343089/pexels-photo-5343089.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
                      alt="snap back hat"
                    />
                  </div>
                  <div className="listContext">
                    <div className="companyName">
                      <h2>{companyName}</h2>
                    </div>
                    <p>{aboutCompany}</p>
                    <div className="companyServices">
                      <div className="serviceTypes">
                        {serviceList.flatmap((x) => {
                          return x;
                        })}
                      </div>
                    </div>
                    <div className="priceAndBook">
                      <div className="listPrice">
                        <div className="moneySign">&#8358;</div>
                        <span className="min-range price">
                          {minPrice}{" "}
                        </span>{" "}
                        <hr />
                        <div className="moneySign">&#8358;</div>
                        <span className="max-range price">{maxPrice}</span>
                      </div>
                      <div className="bookBtn">
                        <button onClick={bookButton}>Book</button>
                      </div>
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
}

export default ServiceBooking;
